INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0.5, 0, "その通り、今日はカスミの誕生日さ～♪\nさっすが名探偵だね～！\nそれじゃあ早速、みんなで歌って踊って\nお祝いするよ～♪", 11, 0, 101711, 1, 26224, 10, 26224068, 1);
