INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0.5, 0, "……気持ちは大変にありがたいが。\nワタシの誕生日を祝って大丈夫なのか？\n表向きには、相当問題のある流れで\nギルドから出奔した女だぞ。", 11, 0, 107111, 1, 35814, 10, 35814065, 1);
