INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0.5, 0, "大体クリスティーナおばさんが\n問題だらけなのは最初からであって、\nそんなのもう誰も気にしてないッスよ！", 11, 0, 100511, 1, 35814, 10, 35814075, 1);
