INSERT INTO `v1_b1504917bb2e238be20cf7ba573e6a1e1af339b17920259608e1b7f0c6ff8a30` VALUES (0.5, 0, "誕生日のお祝い、感謝するにゃ～！\nしかもケーキだけじゃなくて、\nプレゼントまで用意してあるとは……\nみんな、何を持ってきてくれたにゃ？", 11, 0, 104611, 1, 38014, 10, 38014063, 1);
